import React from "react";
import { Paper, Divider } from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../Theme/themes";
import Backdrop from "../Backdrop";
import { styles } from "../styles";

const useStyles = makeStyles((theme) => ({
  ...styles,
  root: {
    background: theme.palette.background.default,
    boxShadow: theme.shadows[8],
    padding: "30px",
  },
  darkBg: {
    background: "rgba(0, 0, 0, 0.6)",
    boxShadow: theme.shadows[8],
    padding: "30px",
  },
  title: { color: "#FFF" },
}));

interface BackDropProps {
    brand: string
    mode: string
    content: string
}

const BackdropExample = ({ brand, mode, content }: BackDropProps) => {
  const classes = useStyles(themes[brand]);

  return (
    <MuiThemeProvider theme={themes[brand]}>
      <Paper className={classes[mode]}>
        <Typography variant="h3">Blackdrop</Typography>
        <br />
        <Divider />
        <br />
        <Grid container>
          <Grid item xs={2}>
            <Backdrop
              img={
                <img
                  src="https://tools-images.services.cvc.com.br/resize?width=400&height=300&url=https://s3.amazonaws.com/cvc-bancodeimagens/destinos/rio-de-janeiro-praia-de-ipanema-rj-brasil-100289234.jpg&type=auto&quality=70"
                  alt=""
                />
              }
              content={
                <Typography variant="h1" className={classes.title}>
                  {content}
                </Typography>
              }
            />
          </Grid>
        </Grid>
      </Paper>
    </MuiThemeProvider>
  );
};

const argsControls = {
  args: {
    brand: "CVC",
    mode: "root",
    content: "Rio de Janeiro",
  },
  argTypes: {
    brand: {
      type: "select",
      options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
    },
    mode: {
      options: ["root", "darkBg"],
      control: { type: "radio" }
    },
    content: { type: "string" },
  }
}

storiesOf("Components/Backdrop", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
  .add("Default", (args) => <BackdropExample {...args}/>, argsControls);
